import React from 'react';
import './Navigation.css';

const Navigation = () => {
	return(
		<nav style={{display:'flex', justifyContent:'flex-end'}}>
			<p className='f6 link dim underline pa3 pointer mv2'>My Cart(4)</p>
		</nav>
	)
}

export default Navigation;
